INSERT INTO esrd.html_tables (id, name, html_content) VALUES (11019, 'Единые (котловые) тарифы
на услуги по передаче электрической энергии по сетям
субъекта Российской Федерации, поставляемой населению
и приравненным к нему категориям потребителей
на _________ 20__ год', '<table border="1" style="border-collapse: collapse;" cellspacing="0" cellpadding="0">
	<thead>
		<tr>
			<td width="9.421487603305785%">
				N п/п
