INSERT INTO esrd.html_tables (id, name, html_content) VALUES (11033, 'Балансовые показатели планового объема
полезного отпуска электрической энергии, используемые
при расчете цен (тарифов) на электрическую энергию
для населения и приравненных к нему категориям
потребителей по субъекту Российской Федерации', '<table border="1" style="border-collapse: collapse;" cellspacing="0" cellpadding="0">
	<thead class="noNumber">
		<tr>
			<th rowspan="3" width="5.813953488372093%">
				N п/п
			</th>
			<th rowspan="3" width="50.16611295681063%">
				Группы (подгруппы) потребителей
			</th>
			<th colspan="4" width="44.01993355481728%">
				Плановый объем полезного отпуска электрической энергии, млн. кВт &middot; ч
			</th>
		</tr>
		<tr>
			<th colspan="2" width="48.484848484848484%">
				I полугодие
			</th>
			<th colspan="2" width="51.515151515151516%">
				II полугодие
			</th>
		</tr>
		<tr>
			<th width="27.169811320754718%">
				В пределах социальной нормы потребления
			</th>
			<th width="21.50943396226415%">
				Сверх социальной нормы потребления
			</th>
			<th width="27.169811320754718%">
				В пределах социальной нормы потребления
			</th>
			<th width="24.150943396226417%">
				Сверх социальной нормы потребления
			</th>
		</tr>
	</thead>
	<tbody>
		<tr>
			<td width="5.813953488372093%">
				1
			</td>
			<td width="50.16611295681063%">
				Население и приравненные к ним, за исключением населения и потребителей, указанных в пунктах 2 и 3: исполнители коммунальных услуг (товарищества собственников жилья, жилищно-строительные, жилищные или иные специализированные потребительские кооперативы либо управляющие организации), приобретающие электрическую энергию (мощность) для предоставления коммунальных услуг собственникам и пользователям жилых помещений и содержания общего имущества многоквартирных домов; наймодатели (или уполномоченные ими лица), предоставляющие гражданам жилые помещения специализированного жилищного фонда, включая жилые помещения в общежитиях, жилые помещения маневренного фонда, жилые помещения в домах системы социального обслуживания населения, жилые помещения фонда для временного поселения вынужденных переселенцев, жилые помещения фонда для временного проживания лиц, признанных беженцами, а также жилые помещения для социальной защиты отдельных категорий граждан, приобретающие электрическую энергию (мощность) для предоставления коммунальных услуг пользователям таких жилых помещений в объемах потребления электрической энергии населением и содержания мест общего пользования в домах, в которых имеются жилые помещения специализированного жилого фонда; юридические и физические лица, приобретающие электрическую энергию (мощность) в целях потребления на коммунально-бытовые нужды в населенных пунктах и жилых зонах при воинских частях и рассчитывающиеся по договору энергоснабжения по показаниям общего прибора учета электрической энергии.
			</td>
			<td width="11.960132890365449%">
				&nbsp;
			</td>
